import React from "react";

const Card = ({names , deleteFunc}) => {

  return (
    <div>
      <div className="cardWrraper">
        {names.map(({ name, Age, addrress, Phone }, index) => (
          <div className="card" key={index}>
            <p>{`Name : ${name}`}</p>
            <p>{`Age : ${Age}`}</p>
            <p>{`addrress : ${addrress}`}</p>
            <p>{`Phone : ${Phone}`}</p>
            <button type="button" className="btn btn-primary btn-floating">
      <i className="fas fa-trash-can" onClick={(e) => deleteFunc(e , index) }></i>
      </button>
          </div>
        ))}
       
      </div>
    </div>
  );
};

export default Card;
